package Assignments3;

public class TableOfFive {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int n = 5;
		
		System.out.println("Multiplication Table of Five: ");
		
		for(int i = 1; i <= 10; i++ ) {
			System.out.println(n+" * "+i+" = "+(n * i));
		}

	}

}
